function TodoItem(props){

  return(
    <div>
      <p style={{
        width: "300px",
        marginBottom: "10px",
        margin: "0 auto",
        border: "1px solid #ccc",
        padding: "10px"
      }}>{props.item}</p>
    </div>
  );
}

export default TodoItem;
